const Header = (props) =>(
    <div><h1>{props.name}</h1></div>
)
const Part =(part) =>(
    <p>{part.name} {part.number}</p>
)
const Content =(props)=>{
    return (
        <div>
            <Part name= 'Fundamentals of React' number ='10'/>
            <Part name= 'Using props to pass data' number='7'/>
            <Part name= 'State of a component' number='14'/>

        </div>
    )
}
const Total = (props) => (
    <p>Number of exercises {props.one+props.two+props.three}</p>
)

const App = () => {
    const course = 'Half Stack application development'
    const part1 = {
        name: 'Fundamentals of React',
        exercises: 10
    }
    const part2 = {
        name: 'Using props to pass data',
        exercises: 7
    }
    const part3 = {
        name: 'State of a component',
        exercises: 14
    }

    return (
        <div>
            <Header name={course}/>
            <Part part={part1}/>
        </div>
    )
}

export default App
